import React from "react";
import Goal from "./Goal";

function GoalsList(props, { checkHandler }) {
  function check(id) {
    console.log("id to changeclass - ", id);
    checkHandler(id);
  }
  return (
    <div className="goals__list">
      <ul className="list">
        {props.goals.length ? (
          props.goals.map((goal, index) => {
            return (
              <Goal
                goal={goal}
                index={index}
                key={goal.id}
                check={checkHandler}
              />
            );
          })
        ) : (
          <div className="list__empty">
            You have nothing to do. <br />
            Add something
          </div>
        )}
      </ul>
    </div>
  );
}

export default GoalsList;
